import React from "react";

class mainApp extends React.Component {
  render() {
    return (
      <main>
        <form>
          <label>
            <input type="text">Name</input>
          </label>
        </form>
        <p>Hola Mundo</p>
      </main>
    );
  }
}

export default mainApp;
